use director;

DROP TABLE IF EXISTS rs485_dru_trama;
DROP TABLE IF EXISTS rs485_dmu_trama;
DROP TABLE IF EXISTS rs485_frecuencia;

CREATE TABLE rs485_dru_trama (
  id int(10) unsigned NOT NULL AUTO_INCREMENT,
  name varchar(255) NOT NULL COLLATE utf8mb4_unicode_ci,  
  type varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci, 
  header varchar(2) NOT NULL COLLATE utf8mb4_unicode_ci, 
  x1 varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  site_number varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  dru_id varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  x2 varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  tx_rx1 varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  x3 varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  message_type varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  tx_rx2 varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  cmd_length varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  cmd_code varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  cmd_data varchar(255) NOT NULL COLLATE utf8mb4_unicode_ci,  
  crc varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  end varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  PRIMARY KEY(id),
  UNIQUE KEY rs485_dru_trama (name)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;





CREATE TABLE rs485_dmu_trama (
  id int(10) unsigned NOT NULL AUTO_INCREMENT,
  name varchar(255) NOT NULL COLLATE utf8mb4_unicode_ci,  
  type varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci, 
  header varchar(2) NOT NULL COLLATE utf8mb4_unicode_ci, 
  dmu_device1 varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  dmu_device2 varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  data_type varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci, 
  cmd_number varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  response_flag varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  cmd_body_lenght varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  cmd_data varchar(255) NOT NULL COLLATE utf8mb4_unicode_ci,  
  crc varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,  
  end varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci,     
  PRIMARY KEY(id),
  UNIQUE KEY rs485_dmu_trama (name)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;





CREATE TABLE rs485_frecuencia (
  code_hex varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci, 
  hex varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci, 
  downlink_frecuency int(10) unsigned NOT NULL COLLATE utf8mb4_unicode_ci, 
  channel varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci, 
  uplink_frecuency_mhz varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci, 
  downlink_frecuency_mhz varchar(20) NOT NULL COLLATE utf8mb4_unicode_ci, 
  description varchar(255) NOT NULL COLLATE utf8mb4_unicode_ci,   
  PRIMARY KEY(code_hex),
  UNIQUE KEY rs485_frecuencia01 (channel),
  UNIQUE KEY rs485_frecuencia02 (description)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;


